Tags: <a data-href="legal-vocab" href="tags/legal-vocab.html" class="internal-link" target="_self" rel="noopener nofollow">legal-vocab</a><br>
Resource: <a data-tooltip-position="top" aria-label="https://www.law.cornell.edu/wex/summary_judgment" rel="noopener nofollow" class="external-link is-unresolved" href="https://www.law.cornell.edu/wex/summary_judgment" target="_self">Cornell Law School</a>A summary judgment is a judgment entered by a court for one party and against another party without a full trial.<br>In&nbsp;<a data-tooltip-position="top" aria-label="https://www.nolo.com/dictionary/civil-case-term.html" rel="noopener nofollow" class="external-link is-unresolved" href="https://www.nolo.com/dictionary/civil-case-term.html" target="_self">civil cases</a>,&nbsp;either&nbsp;<a data-tooltip-position="top" aria-label="https://www.law.cornell.edu/wex/party" rel="noopener nofollow" class="external-link is-unresolved" href="https://www.law.cornell.edu/wex/party" target="_self">party</a>&nbsp;may make a pre-trial&nbsp;<a data-tooltip-position="top" aria-label="https://www.law.cornell.edu/wex/motion_for_summary_judgment" rel="noopener nofollow" class="external-link is-unresolved" href="https://www.law.cornell.edu/wex/motion_for_summary_judgment" target="_self">motion&nbsp;for summary judgment</a>.&nbsp;<br>For&nbsp;<a data-tooltip-position="top" aria-label="https://www.law.cornell.edu/wex/federal_courts" rel="noopener nofollow" class="external-link is-unresolved" href="https://www.law.cornell.edu/wex/federal_courts" target="_self">federal courts</a>,&nbsp;<a data-tooltip-position="top" aria-label="https://www.law.cornell.edu/rules/frcp/rule_56" rel="noopener nofollow" class="external-link is-unresolved" href="https://www.law.cornell.edu/rules/frcp/rule_56" target="_self">Rule 56</a>&nbsp;of the&nbsp;<a data-tooltip-position="top" aria-label="https://www.law.cornell.edu/rules/frcp" rel="noopener nofollow" class="external-link is-unresolved" href="https://www.law.cornell.edu/rules/frcp" target="_self">Federal Rules of Civil Procedure</a>&nbsp;governs summary judgment. Under Rule 56,&nbsp;in order to succeed in a motion for summary judgment, a&nbsp;<a data-tooltip-position="top" aria-label="https://www.law.cornell.edu/wex/movant" rel="noopener nofollow" class="external-link is-unresolved" href="https://www.law.cornell.edu/wex/movant" target="_self">movant</a>&nbsp;must show:&nbsp;
<br>There is no genuine&nbsp;issue of&nbsp;<a data-tooltip-position="top" aria-label="https://www.law.cornell.edu/wex/material" rel="noopener nofollow" class="external-link is-unresolved" href="https://www.law.cornell.edu/wex/material" target="_self">material</a>&nbsp;fact, and&nbsp;
<br>The&nbsp;movant&nbsp;is entitled to&nbsp;<a data-tooltip-position="top" aria-label="https://www.law.cornell.edu/wex/judgment_as_a_matter_of_law" rel="noopener nofollow" class="external-link is-unresolved" href="https://www.law.cornell.edu/wex/judgment_as_a_matter_of_law" target="_self">judgment as a matter of law</a><a data-tooltip-position="top" aria-label="https://www.law.cornell.edu/wex/table_civil_procedure" rel="noopener nofollow" class="external-link is-unresolved" href="https://www.law.cornell.edu/wex/table_civil_procedure" target="_self">.</a>
<br>A “<a data-tooltip-position="top" aria-label="https://www.law.cornell.edu/wex/genuine_issue_of_material_fact" rel="noopener nofollow" class="external-link is-unresolved" href="https://www.law.cornell.edu/wex/genuine_issue_of_material_fact" target="_self">genuine issue of material fact</a>" exists if evidence could allow a factfinder to decide against the&nbsp;movant. A movant is entitled to judgment as a matter of law if evidence no reasonable jury could rule against the movant based on the facts.<br><a data-tooltip-position="top" aria-label="https://www.law.cornell.edu/wex/table_civil_procedure" rel="noopener nofollow" class="external-link is-unresolved" href="https://www.law.cornell.edu/wex/table_civil_procedure" target="_self">Many states have similar pre-trial motions</a>. For example, in New York, summary judgment is governed by&nbsp;<a data-tooltip-position="top" aria-label="https://nycourts.gov/courts/nyc/civil/cplr3212.shtml/directory-court.shtml" rel="noopener nofollow" class="external-link is-unresolved" href="https://nycourts.gov/courts/nyc/civil/cplr3212.shtml/directory-court.shtml" target="_self">N.Y. C.P.L.R. § 3212</a>. In California,&nbsp;<a data-tooltip-position="top" aria-label="https://law.justia.com/codes/california/code-ccp/part-2/title-6/chapter-5/section-437c/" rel="noopener nofollow" class="external-link is-unresolved" href="https://law.justia.com/codes/california/code-ccp/part-2/title-6/chapter-5/section-437c/" target="_self">Cal. Code Civ. Proc. § 437c</a>&nbsp;provides the applicable provisions.&nbsp;<br><a data-tooltip-position="top" aria-label="https://www.law.cornell.edu/wex/judge" rel="noopener nofollow" class="external-link is-unresolved" href="https://www.law.cornell.edu/wex/judge" target="_self">Judges</a>&nbsp;may also grant partial summary judgment to resolve some issues in the case and leave the others for trial. For example, a judge might rule on some factual issues pre-trial but leave the more complicated ones for&nbsp;<a data-tooltip-position="top" aria-label="https://www.law.cornell.edu/wex/trial" rel="noopener nofollow" class="external-link is-unresolved" href="https://www.law.cornell.edu/wex/trial" target="_self">trial</a>. Alternately, a judge might grant summary judgment regarding&nbsp;<a data-tooltip-position="top" aria-label="https://www.law.cornell.edu/wex/liability" rel="noopener nofollow" class="external-link is-unresolved" href="https://www.law.cornell.edu/wex/liability" target="_self">liability</a>, but still hold a trial to determine&nbsp;<a data-tooltip-position="top" aria-label="https://www.law.cornell.edu/wex/damages" rel="noopener nofollow" class="external-link is-unresolved" href="https://www.law.cornell.edu/wex/damages" target="_self">damages</a>.<br>When considering a motion for summary judgment, the court views all evidence in the light most favorable to the&nbsp;non-movant. If the evidence is “merely colorable, or is not significantly probative,” summary judgment may be granted. In federal courts, a summary judgment does not necessarily lessen the burden for the non-movant: the non-movant still bears the burden of coming forward with sufficient evidence on each element that must be proved. See:&nbsp;<a data-tooltip-position="top" aria-label="https://supreme.justia.com/cases/federal/us/477/242/" rel="noopener nofollow" class="external-link is-unresolved" href="https://supreme.justia.com/cases/federal/us/477/242/" target="_self"><em></em>, Inc., 477 U.S. 242, 249-50 (1986)</a>Anderson v. Liberty Lobby.&nbsp;<br>New York state courts follow a&nbsp;<a data-tooltip-position="top" aria-label="https://www.law.cornell.edu/wex/shifting_the_burden_of_proof" rel="noopener nofollow" class="external-link is-unresolved" href="https://www.law.cornell.edu/wex/shifting_the_burden_of_proof" target="_self">burden-shifting</a>&nbsp;approach. First, the moving party must show that there is no genuine issue of material fact and that the party is entitled to judgment as a matter of law. Once the moving party satisfies its initial burden, the burden shifts to the non-movant to show the possibility of a factual issue and/or that the moving party is not entitled to judgment as a matter of law.<br>When a party moves for summary judgment, there is no need for that party to submit "<a data-tooltip-position="top" aria-label="https://www.law.cornell.edu/wex/affidavit" rel="noopener nofollow" class="external-link is-unresolved" href="https://www.law.cornell.edu/wex/affidavit" target="_self">affidavits</a>&nbsp;or other similar materials" to support the motion.&nbsp;See&nbsp;<a data-tooltip-position="top" aria-label="https://supreme.justia.com/cases/federal/us/477/317/" rel="noopener nofollow" class="external-link is-unresolved" href="https://supreme.justia.com/cases/federal/us/477/317/" target="_self"><em></em>, 477 U.S. 317 (1986)</a>Celotex&nbsp;Corp. v.&nbsp;Catrett.If the motion is granted for a full summary judgment, there will be no trial. The judge will immediately enter judgment for the&nbsp;movant. If the motion is granted for a partial summary judgment, the trial remains to resolve the remaining issues.
